import React from "react";
import styled from "styled-components";
import CoverVideo from "../components/CoverVideo";
import Logo from "../components/Logo";

const Section = styled.section`
	min-height: 200vh;
	overflow: hidden;
`;

const Home = () => {
	return (
		<Section>
			<CoverVideo />
			<Logo />
			<h1>NavBar</h1>
		</Section>
	);
};

export default Home;
